import axios from "axios";
import { useCallback, useEffect, useState } from "react";
import DataTable from "react-data-table-component";

export const Preview = ({ setSelectedRow }) => {
  const [data, setData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  const getListData = async () => {
    try {
      const response = await axios.get("//localhost:8000/get");
      if (response.status !== 200) {
        throw new Error(`HTTP error! Status: ${response.status}`);
      }
      const result = response.data;
      if (result.success) {
        setData(result.data);
      } else {
        setError(result.error);
      }
    } catch (error) {
      setError(error.message);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    getListData();
  }, []);

  const columns = [
    {
      name: "Id",
      selector: (row) => row.Id,
    },
    {
      name: "FirstName",
      selector: (row) => row.FirstName,
    },
    {
      name: "LastName",
      selector: (row) => row.LastName,
    },
    {
      name: "Gender",
      selector: (row) => row.Gender,
    },
    {
      name: "Country",
      selector: (row) => row.Country,
    },
    {
      name: "Age",
      selector: (row) => row.Age,
    },
    {
      name: "Date",
      selector: (row) => row.Date,
    },
  ];

  const handleOnSelectChanged = useCallback(
    ({ selectedRows }) => {
      if (selectedRows.length) setSelectedRow(selectedRows[0]);
    },
    [setSelectedRow]
  );

  if (!data) {
    return null;
  }

  return (
    <>
      <div style={{ border: "1px solid black", margin: "40px" }}>
        <DataTable
          noHeader
          columns={columns}
          data={data}
          pagination={true}
          selectableRows
          onSelectedRowsChange={handleOnSelectChanged}
          selectableRowsSingle
        />
      </div>
    </>
  );
};
